import './Navbar.css';
import { Link } from 'react-router-dom';
import React from 'react';

function Navbar() {
  return(
    React.createElement("header", { className: "navbar" }, 
    React.createElement("div", { className: "navbar__title navbar__item", href:"/"},"Webshop"),
    React.createElement("div", { className: "navbar__item", href:""}, "Add Item"), 
    React.createElement("div", { className: "navbar__item", href:"" }, "Add Category"), 
    React.createElement("div", { className: "navbar__item", href:"/cart" }, "Cart")
  ))
}


export default Navbar
